tables.table_schema:
CREATE TABLE quantum_results (
    result_id INT PRIMARY KEY,
    algorithm_name VARCHAR(255),
    execution_time DOUBLE PRECISION,
    result_data JSONB
);

CREATE TABLE performance_analysis (
    analysis_id INT PRIMARY KEY,
    result_id INT REFERENCES quantum_results(result_id),
    analysis_date TIMESTAMP,
    success_rate DOUBLE PRECISION
);

CREATE TABLE quantum_algorithm_results (
    algorithm_id INT PRIMARY KEY,
    execution_time FLOAT,
    success BOOLEAN
);

CREATE TABLE algorithm_performance (
    algorithm_id INT PRIMARY KEY,
    performance_score FLOAT
);

CREATE TABLE execution_logs (
    log_id INT PRIMARY KEY,
    algorithm_id INT,
    execution_time TIMESTAMP,
    log_message TEXT
);

CREATE TABLE Results (
   result_id INT PRIMARY KEY,
   algorithm_name VARCHAR(255),
   execution_time FLOAT,
   created_at TIMESTAMP
);

CREATE TABLE QuantumAlgorithms (
   algorithm_id INT PRIMARY KEY,
   algorithm_name VARCHAR(255),
   complexity VARCHAR(255)
);

CREATE TABLE algorithm_results (
    result_id INT PRIMARY KEY,
    algorithm_name VARCHAR(255),
    execution_time FLOAT,
    result_data TEXT
);

CREATE TABLE quantum_circuit (
    circuit_id INT PRIMARY KEY,
    circuit_description TEXT,
    circuit_elements JSONB
);

CREATE TABLE performance_metrics (
    metric_id INT PRIMARY KEY,
    metric_name VARCHAR(255),
    metric_value FLOAT
);

CREATE TABLE algorithm_runs (
    run_id INT PRIMARY KEY,
    algorithm_id INT,
    start_time TIMESTAMP,
    end_time TIMESTAMP
);

CREATE TABLE algorithm_parameters (
    parameter_id INT PRIMARY KEY,
    algorithm_id INT,
    parameter_name VARCHAR(255),
    parameter_value TEXT
);
